  const [image, setImgae] = useState("");

  return (
    <div className="App">
      <div className="information">
        <label>Title</label>
        <input type="text" onChange={(event) => {
          setTitle(event.target.value)
        }}/>
        <label>Author</label>
        <input type="text" />
        <label>Year</label>
        <input type="number" />
        <label>Image</label>
        <input type="text" />
        <button>Add Book</button>
      </div>
    </div>
  );
}

export default App;
